import React, { Component } from 'react';

import './CreatePage.css';

class CreatePage extends Component {
    constructor(props) {
        super(props);

        this.state={
            name: null,
            address: null,
            rating: null,
            type: null,
            picture: null,
        }

        this.handleInputChange = this.handleInputChange.bind(this);
    }

    handleInputChange(event) {
        const target = event.target;

        switch(target.id) {
            case 'name':
                this.setState({
                    name: target.value,
                });
                break;
            case 'address':
                this.setState({
                    address: target.value,
                });
                break;
            case 'rating':
                this.setState({
                    rating: target.value,
                });
                break;
            case 'type':
                this.setState({
                    type: target.value,
                });
                break;
            case 'picture':
                this.setState({
                    picture: target.files,
                });
                break;
            default:
        }
    }

    render() {
        return (
            <div>
                <h2> Add a New Tourist Place</h2>
                <div className="container">
                   <form>
                        <div className="row">
                            <div className="col-25">
                                <label> Name: </label>
                            </div>
                            <div className="col-75">
                                <input type="text" id="name" name="name" onChange={this.handleInputChange} />
                            </div>
                        </div>

                        <div className="row">
                            <div className="col-25">
                                <label> Address: </label>
                            </div>
                            <div className="col-75">
                                <input type="text" id="address" name="address" onChange={this.handleInputChange} />
                            </div>
                        </div>

                        <div className="row">
                            <div className="col-25">
                                <label> Rating: </label>
                            </div>
                            <div className="col-75">
                                <input type="number" id="rating" name="rating" min="1" max="5" />
                            </div>
                            <div className="col-90">
                                <p>Range 1 to 5</p>
                            </div>
                        </div>

                        <div className="row">
                            <div className="col-25">
                            <label> Type: </label>
                            </div>
                            <div>
                            <select className="col-75" id="type" name="type">
                                <option value="beach">Beach</option>
                                <option value="hills">Hills</option>
                                <option value="fountain">Fountain</option>
                                <option value="landmark">Landmark</option>
                            </select>
                            </div>
                            <div className="type-label">
                                Beach <br />
                                Hills <br />
                                Fountain <br />
                                Landmark
                            </div>
                        </div>

                        <div className="row">
                            <div className="col-25">
                                <label> Picture: </label>
                            </div>
                            <div className="col-75">
                                <input type="file" id="picture" name="picture" accept="image/*" />
                            </div>
                        </div>

                        <div className="row">
                            <input type="reset" value="Reset" id="reset" />
                            <input type="submit" value="Submit" id="submit" />
                        </div>
                   </form>
                </div>
            </div>
        );
    }
}

export default CreatePage;
